import React from 'react';
import { FaCar, FaCarSide, FaCarAlt } from 'react-icons/fa';
import './RideOptions.css';

const RideOptions = () => {
  const rides = [
    {
      name: "UberX",
      time: "8:31am",
      price: "$10.00",
      type: "standard",
      eta: "",
      icon: <FaCar className="icon uberx-icon" />
    },
    {
      name: "Comfort Electric",
      time: "8:36am",
      price: "$15.00",
      type: "electric",
      eta: "5 min away",
      icon: <FaCarAlt className="icon electric-icon" />
    },
    {
      name: "Black",
      time: "8:38am",
      price: "$30.00",
      type: "premium",
      eta: "",
      icon: <FaCarSide className="icon black-icon" />
    }
  ];

  return (
    <div className="ride-options-container">
      {/* <h3 className="ride-options-title">Available Rides</h3> */}
      
      <div className="rides-list">
        {rides.map((ride, index) => (
          <div key={index} className={`ride-card ${ride.type}`}>
            <div className="ride-icon">{ride.icon}</div>
            
            <div className="ride-info">
              <div className="ride-name-time">
                <span className="ride-name">{ride.name}</span>
                <span className="ride-time">
                  {ride.time}
                  {ride.eta && <span className="ride-eta"> - {ride.eta}</span>}
                </span>
              </div>
            </div>
            
            <div className="ride-price">{ride.price}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default RideOptions;
